import React from 'react';

// const browserTimezone = Intl.DateTimeFormat().resolvedOptions().timeZone;

const WeatherForecast = ({ forecast }) => {
    return (
        <div>
            <h2>Weather Forecast</h2>
            {forecast.map((item) => (
                <div key={item.dateTime}>
                    <p>Date: {item.dateTime}</p>
                    <p>Temperature: {item.temperature}°F</p>
                    <p>Description: {item.description}</p>
                    <p>Humidity: {item.humidity}%</p>
                    <p>Wind Speed: {item.windSpeed} m/s</p>
                </div>
            ))}
        </div>
    );

    return (
        <div className="container">
            <h1>Weather App</h1>
            <div className="row">
                {dailyForecast.map((forecast, index) => (
                    <div className="col-md-4" key={index}>
                        <div className="card mb-4">
                            <div className="card-body">
                                <h5 className="card-title">{item.dateTime}}</h5>
                                <p className="card-text">Temperature: {forecast.temperature}°C</p>
                                <p className="card-text">Description: {forecast.description}</p>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default WeatherForecast;
